import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './pages/public/Home';
import About from './pages/protected/About';
import Contact from './pages/protected/Contact';
import Login from './pages/public/Login';
import Signup from './pages/public/SignUp';
import Admin from './pages/protected/Admin';
import User from './pages/protected/User';
import Profile from './pages/protected/Profile';
import { DarkModeProvider } from './context/DarkModeContext';
import AdminProfilePage from './pages/protected/AdminProfilePage';
import MessDetailsPage from './pages/protected/MessDetailsPage';
import AuditLogsPage from './pages/protected/AuditLogsPage';
import BillingPage from './pages/protected/BillingPage';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/common/ProtectedRoute';
import PublicRoute from './components/common/PublicRoute';

function App() {
  return (
    <DarkModeProvider>
      <AuthProvider>
        <Router>
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route 
              path="/login" 
              element={
                <PublicRoute>
                  <Login />
                </PublicRoute>
              } 
            />
            <Route 
              path="/signup" 
              element={
                <PublicRoute>
                  <Signup />
                </PublicRoute>
              } 
            />

            {/* Protected User Routes */}
            <Route 
              path="/user" 
              element={
                <ProtectedRoute allowedRoles={['user', 'admin']}>
                  <User />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/user/profile" 
              element={
                <ProtectedRoute allowedRoles={['user', 'admin']}>
                  <Profile />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/about" 
              element={
                <ProtectedRoute>
                  <About />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/contact" 
              element={
                <ProtectedRoute>
                  <Contact />
                </ProtectedRoute>
              } 
            />

            {/* Protected Admin Routes */}
            <Route 
              path="/admin" 
              element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <Admin />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/admin/profile" 
              element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <AdminProfilePage />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/admin/mess-details" 
              element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <MessDetailsPage />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/admin/audit-logs" 
              element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <AuditLogsPage />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/admin/billing" 
              element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <BillingPage />
                </ProtectedRoute>
              } 
            />

            {/* 404 Page */}
            <Route path="*" element={<div>404 Not Found</div>} />
          </Routes>
        </Router>
      </AuthProvider>
    </DarkModeProvider>
  );
}

export default App;
